    [],nt"num_tags": 4,nt"name": "burford-lake-wildlife-management-area-narrative-report-may-june-july-august-1957",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Burford Lake
    Wildlife Management Area outlines Refuge accomplishments from May through August
    of 1957. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, predators, rodents, raptors, and fish- is also covered. The Refuge
    development and maintenance section discusses physical developments, plantings,
    and wildfires. The public relations section of the report describes recreational
    uses, Refuge visitors, and Refuge participation. Items of interest and N-R forms
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
